    return (
        <div>
        {/* Vous pouvez utiliser l'image importée ici */}
            <img style={{maxHeight:"400px",maxWidth:"900px"}} src={mobileDev} alt="Mobile Development" />
        {/* Autres éléments de votre composant */}
      </div>
    );
  }
}
